import React from 'react'


const WeatherData = ({ data }) => {
  const { name, country, temp, description, temp_min, temp_max, icon, feels_like, speed, deg, humidity } = data;
  if (description === 'haze'){
    console.log("YES IT IS HAZEY");
  }
  return (
    <>
      <main>
        <div className='weather-main'>
          <div>
            <h1>{name}, {country}</h1>
            <h2 className='description'>{description}</h2>
          </div>
        </div>
        <div className='temp-main'>
          <h1>Feels like {feels_like} 째C</h1>
          <h2 className='temperature'>{temp}째</h2>

            <h3>Today's High {temp_max}째</h3>
            <h3>Today's Low {temp_min}째</h3>
            <h4>{icon}</h4> 
            <h5>{speed}</h5>
            <h6>{deg}</h6>

        </div>
        <div>
          <h4>Humidity: {humidity} %</h4>
        </div>
      </main>

    </>
  );
}

export default WeatherData;
